// src/pages/LandingPage.tsx

import React from 'react';
import Header from '../components/Header';
import Button from '../components/Button';
import FeatureList from '../components/FeatureList';
import { useNavigate } from 'react-router-dom';

const LandingPage: React.FC = () => {
  const navigate = useNavigate();

  return (
    <main className="flex flex-col items-center px-7 pb-10 mx-auto w-full max-w-md text-white bg-red-500 min-h-screen">
      <Header title="Welcome to Picante" />
      <p className="mt-4 text-center">
        Generate stunning images with AI. Subscribe to get unlimited access and exclusive features.
      </p>
      <Button
        text="Get Started"
        className="mt-6 bg-blue-500 text-white"
        onClick={() => navigate('/generate')}
      />
      <FeatureList
        features={[
          'Unlimited Images',
          'Priority Processing',
          'AI Upscaling',
          'Access to Animation Features',
        ]}
      />
      <Button
        text="Log In"
        className="mt-4 bg-neutral-200 text-black"
        onClick={() => navigate('/login')}
      />
    </main>
  );
};

export default LandingPage;
